import React from 'react';
import classes from './ContactLoggedIn.module.css';

const paragraph = 'Get in touch with us for any information or help at:\nTel.: 0759874658\nEmail: trauma.team@tteam.com';

function ContactLoggedIn({ onClose }) {
    return (
        <div className={classes.meetingItem}>
            <div className={classes.cardContent}>
                <h3 className={classes.meetingDoctor}>Contact Information</h3>
                <p className={classes.meetingField}>{paragraph}</p>
                <button className={classes.closeButton} onClick={onClose}>Close</button>
            </div>
        </div>
    );
}

export default ContactLoggedIn;
